import React, { useState } from 'react';
import { useMutation } from '@apollo/react-hooks';
import gql from 'graphql-tag';

export interface SetupProps {}

const RUN_SETUP = gql`
  mutation runSetup($success: Boolean) {
    runSetup(success: $success) {
      success
    }
  }
`;

const Setup: React.FC<SetupProps> = () => {
  const [state, updateState] = useState(false);
  const [runSetup, { data, loading: runSetupLoading }]: any = useMutation(
    RUN_SETUP,
    {
      onCompleted: () => {
        alert('Okay your ready to rock!');
        console.log(data);
      }
    }
  );

  const runFullSetup = success => {
    runSetup({ variables: { success } });
  };

  return (
    <div className="container">
      <h1>SetUp Page</h1>
      <p>All right your ready to run your website setup!</p>
      <button
        type="button"
        className="btn btn-primary"
        onClick={() => runFullSetup(true)}
      >
        Run SetUp
      </button>
      <span>{runSetupLoading ? '...loading' : ''}</span>
    </div>
  );
};

export default Setup;
